const categories = [
  { name: "Dry Fruits", subcategories: ["Almonds", "Cashews", "Dates", "Walnuts", "Pistachios", "Raisins", "Apricots", "Brazil Nuts", "Hazelnuts", "Macadamia"] },
  { name: "Healthy Snacks", subcategories: ["Trail Mix", "Roasted Nuts", "Nut Bars", "Seed Mixes"] },
  { name: "Coconut Products", subcategories: ["Fresh Coconut", "Dried Coconut", "Coconut Oil", "Coconut Chips"] },
  { name: "Gift Boxes & Combos", subcategories: ["Festive Boxes", "Corporate Gifts", "Family Packs", "Custom Boxes"] },
  { name: "Seasonal Specials", subcategories: ["Diwali Special", "Christmas Special", "Summer Special", "Monsoon Special"] }
];

function App() {
  const [cartItems, setCartItems] = useState([]);
  const [user, setUser] = useState(null);
  const [showAdmin, setShowAdmin] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const [showLoginModal, setShowLoginModal] = useState(false);
  const [products, setProducts] = useState(initialProducts);
  const [filteredProducts, setFilteredProducts] = useState(initialProducts);

  
  useEffect(() => {
    const userCookie = document.cookie.split('; ').find(row => row.startsWith('user='));
    if (userCookie) {
      const userData = JSON.parse(decodeURIComponent(userCookie.split('=')[1]));
      setUser(userData);
    }
  }, []);

  
  useEffect(() => {
    if (searchQuery) {
      const filtered = products.filter(product => 
        product.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
        product.description.toLowerCase().includes(searchQuery.toLowerCase()) ||
        product.category.toLowerCase().includes(searchQuery.toLowerCase()) ||
        product.subcategory.toLowerCase().includes(searchQuery.toLowerCase())
      );
      setFilteredProducts(filtered);
    } else {
      setFilteredProducts(products);
    }
  }, [searchQuery, products]);

  const addToCart = (product) => {
    if (!user) {
      setShowLoginModal(true);
      return;
    }
    
    
    if (!product.inStock || product.stock === 0) {
      alert("Sorry, this product is out of stock!");
      return;
    }
    
    const existingItem = cartItems.find(item => item.id === product.id);
    if (existingItem) {
      
      if (existingItem.quantity + 1 > product.stock) {
        alert(`Only ${product.stock} items available in stock!`);
        return;
      }
      
      setCartItems(cartItems.map(item => 
        item.id === product.id ? { ...item, quantity: item.quantity + 1 } : item
      ));
    } else {
      setCartItems([...cartItems, { ...product, quantity: 1 }]);
    }
  };

  const removeFromCart = (productId) => {
    setCartItems(cartItems.filter(item => item.id !== productId));
  };

  const updateQuantity = (productId, newQuantity) => {
    if (newQuantity < 1) {
      removeFromCart(productId);
      return;
    }
    
    
    const product = products.find(p => p.id === productId);
    if (newQuantity > product.stock) {
      alert(`Only ${product.stock} items available in stock!`);
      return;
    }
    
    setCartItems(cartItems.map(item => 
      item.id === productId ? { ...item, quantity: newQuantity } : item
    ));
  };

  const loginUser = (userData) => {
    setUser(userData);
    
    const expires = new Date(Date.now() + 30 * 24 * 60 * 60 * 1000).toUTCString();
    document.cookie = `user=${encodeURIComponent(JSON.stringify(userData))}; expires=${expires}; path=/`;
    setShowLoginModal(false);
    
    
    if (userData.email === "admin@dryfruits.com") {
      setShowAdmin(true);
    }
  };

  const logoutUser = () => {
    setUser(null);
    setShowAdmin(false);
    
    document.cookie = 'user=; expires=Thu, 01 Jan 1970 00:00:00 GMT; path=/';
  };

  const updateProducts = (updatedProducts) => {
    setProducts(updatedProducts);
  };

  return (
    <Router>
      <div className="App">
        {showAdmin ? (
          <AdminPanel 
            products={products} 
            categories={categories} 
            onClose={() => setShowAdmin(false)}
            onUpdateProducts={updateProducts}
          />
        ) : (
          <>
            <Header 
              cartItems={cartItems} 
              user={user} 
              onLogin={() => setShowLoginModal(true)} 
              onLogout={logoutUser}
              onSearch={setSearchQuery}
              categories={categories}
            />
            
            <Routes>
              <Route path="/" element={
                <>
                  <Hero />
                  <ProductGrid 
                    products={filteredProducts.slice(0, 8)} 
                    title="Best Sellers" 
                    onAddToCart={addToCart} 
                  />
                  <ProductGrid 
                    products={products.filter(p => p.category === "Healthy Snacks")} 
                    title="Healthy Snacks" 
                    onAddToCart={addToCart} 
                  />
                  <ProductGrid 
                    products={products.filter(p => p.category === "Gift Boxes & Combos")} 
                    title="Gift Boxes & Combos" 
                    onAddToCart={addToCart} 
                  />
                </>
              } />
              <Route path="/product/:id" element={
                <ProductPage products={products} onAddToCart={addToCart} user={user} />
              } />
              <Route path="/cart" element={
                <Cart 
                  cartItems={cartItems} 
                  onUpdateQuantity={updateQuantity} 
                  onRemoveItem={removeFromCart} 
                  user={user}
                  onLogin={() => setShowLoginModal(true)}
                />
              } />
              <Route path="/checkout" element={
                <Checkout 
                  cartItems={cartItems} 
                  user={user} 
                  onLogin={() => setShowLoginModal(true)} 
                />
              } />
              <Route path="/category/:categoryName" element={
                <CategoryPage 
                  products={products} 
                  categories={categories} 
                  onAddToCart={addToCart} 
                />
              } />
            </Routes>
            
            <Footer categories={categories} />
            
            {showLoginModal && (
              <LoginModal 
                onLogin={loginUser} 
                onClose={() => setShowLoginModal(false)} 
              />
            )}
          </>
        )}
      </div>
    </Router>
  );
}

export default App;
